import styles from "../css/";
import close from "../assets/icon-close.svg";

const Hamburgermenu = () => {
  return (
    <nav className={styles.hamburgermenu}>
      <img src={close} alt="close" />
      <ol>
        <li>Collections</li>
        <li>Men</li>
        <li>Women</li>
        <li>About</li>
        <li>Contact</li>
      </ol>
    </nav>
  );
};

export default Hamburgermenu;
